import React from "react";
import "./App.css";
import Nav from "./Nav";
import Header from "./Header";
import Main from "./Main";
import Footer from "./Footer";

function App() {
  return (
    <React className="App">
      <Nav />
      <Header />
      <Main />
      <Footer />
    </React>
  );
}

export default App;
